def multiples(m, n):
	output = []
	for i in range(1, m+1):
		output.append(n*i)
	return output

def likes(names):
	if len(names) > 3:
		return f'{names[0]}, {names[1]} and {len(names)-2} others like this'
	elif len(names) > 2:
		return f'{names[0]}, {names[1]} and {names[2]} like this'
	elif len(names) > 1:
		return f'{names[0]} and {names[1]} like this'
	elif len(names) > 0:
		return f'{names[0]} likes this'
	else:
		return 'no one likes this'


def puzzle_solver(pieces, width, height):
	
	#finds the top left piece
	for part in pieces:
		if part[0] == (None, None) and part[1][0] == None:
			side_needed = part
			top_left = part

	#makes a list of all the pieces on the left side in order from top to bottom
	list_of_left_starts = [top_left]
	for i in range(1, height):
		for part in pieces:
			if part[0][0] == top_left[1][0] and part[0][1] == top_left[1][1]:
				list_of_left_starts.append(part)
				top_left = pieces.pop(pieces.index(part))
				break

	#starts sorting the rows from left to right, once for each piece in the (list_of_left_starts) resetting the side_needed each time
	answers = []
	for left_part in list_of_left_starts:
		answers.append(left_part[2])
		for i in range(1, width):
			for part in pieces:
				if part[0][0] == left_part[0][1] and part[1][0] == left_part[1][1]:
					answers.append(part[2])
					left_part = pieces.pop(pieces.index(part))
					break

	#format the answer
	output = []
	for i in range(int(len(answers)/width)):
		output.append(tuple(answers[:width]))
		answers = answers[width:]

	return output
				



	

